//ROUTERS ---->link specific components one page to another page ("link tag")
//applicable both claass and functions

import { BrowserRouter  as Router,Routes,Route,Link } from "react-router-dom";
import {Home} from "./Home.js"

import "./route.css"
function App4(){
    return(
        <div>
            <Router>
            <ul>
                <li>
                 <Link to="./a">Home</Link>
                </li>
                
                <li>
                </li>
                <li>NOTICE</li>
                <li>
                CONTACT US
                </li>
                <li>HELP LINE</li>
            </ul>
           
            </Router> <Routes/>
              
                 
          
        </div>
    )
}
export default App4;
